import React, { Component } from 'react';
import ToDoItem from './ToDoItem';
import AppHeader from './AppHeader';

export default class ToDoList extends Component {
  render() {
    return (
        <div>
            <AppHeader/>
            <ToDoItem/>
        </div>     
    )
  }
}
